function initMap() {

    var latitude;
    var longitude;

    var geocoder = new google.maps.Geocoder();
    //var address = '33301';
    var result=getZipCode();
    var address=result.zipCode;

    geocoder.geocode({ 'address': address }, function (results, status) {
        if (status == google.maps.GeocoderStatus.OK) {
            latitude = results[0].geometry.location.lat();
            longitude = results[0].geometry.location.lng();
            var mapOptions = {
                center: { lat: latitude, lng: longitude },
                zoom: 14,
                // maxZoom:17,
                mapTypeId: google.maps.MapTypeId.ROADMAP,
                clickableIcons: false
            };

            emptymap = new google.maps.Map(document.getElementById("dvCanvas"), mapOptions);
            //alert("Latitude: " + latitude + "\nLongitude: " + longitude);
        } else {
            latitude = 26.085916;
            longitude = -80.173402;
            var mapOptions = {
                center: { lat: latitude, lng: longitude },
                zoom: 14,
                //maxZoom: 17,
                mapTypeId: google.maps.MapTypeId.ROADMAP,
                clickableIcons: false
            };

            emptymap = new google.maps.Map(document.getElementById("dvCanvas"), mapOptions);
            //alert("Request failed.")
        }
    });

    // Geolaction();

    //emptymap = new google.maps.Map(document.getElementById('dvMap'), {
    //    center: { lat: 26.085916, lng: -80.173402 },
    //    zoom: 8
    //});
}

//*********Call Timer tick enent based on time in sec**********************//
async function refresh() {
   
    const data = await GetInTransitMapPoints();
    // Get Service

    
    if (data.length > 0) {
        var myLatlng = new google.maps.LatLng(data[0].latitude, data[0].longitude);
        transition(data[0]);  
    }


}

//*********Moveing car icon marker **********************//
async function transition(dataEntity) {
    const data = await GetInTransitMapPoints();

    if (dataEntity.partyStatus != 6) {

        DistanceMatrix(dataEntity);
    }
    else {
        
        if (dataEntity.partyStatus == 6) {
            dvDistance.innerHTML = "";
            dvNotes.innerHTML = "";
            dvDistance.innerHTML = "Thank You! completed your trip";
            clearMarkersDirection();
            marker.setMap(null);
        }
        
    }
}

//********* initial method**********************//
async function GetRoute() {
    
    // Get Service Data based on Driver Id
    const data = await GetInTransitMapPoints();

    if (data.length != 0) {


        for (var i = 0; i < markers.length; i++) {
            markers[i].setMap(null);
            markers = [];
        }
        var mumbai = new google.maps.LatLng(data[0].latitude, data[0].longitude);

        position = [data[0].latitude, data[0].longitude];
        var mapset = data[0].mapSetting;

        var mapOptions = {
            zoom: 14,
            center: mumbai,
            maxZoom: 18,
            clickableIcons: false,
            mapTypeId: google.maps.MapTypeId.ROADMAP,
            travelMode: google.maps.TravelMode.DRIVING
        };
        //alert(mapset);
        if (mapset === true)
            map = new google.maps.Map(document.getElementById('dvCanvas'), mapOptions);
        else { }

        marker = new google.maps.Marker({
            map: map,
            icon: icon,

        });
        marker.setPosition(mumbai);

        var rendererOptions = {
            map: map,
            suppressMarkers: true
        };
        directionsService = new google.maps.DirectionsService;
        directionsDisplay = new google.maps.DirectionsRenderer(rendererOptions);
        if (data.PartyStatus != 6) {

        }
        if (data.PartyStatus == 6) {
            dvDistance.innerHTML = "";
            dvDistance.innerHTML = "Thank You! completed your trip";
            clearMarkersDirection();
            initMap();
            //timer.Stop();
        }
    }
    else {

        initMap();
        dvDistance.innerHTML += "DRIVER ON THE WAY. PLEASE BE PATIENT. DRIVER TRACKING NOT AVAILABLE AT THIS TIME." + "<br />";
    }


};

