function makeMarker(position, icon, title) {

    if (dirmarkers.length == 0) {

        dirmarker = new google.maps.Marker({
            position: position,
            map: map,
            icon: icon,
            title: title
        });
        dirmarkers.push(dirmarker);
    }
    if (dirdmarkers.length == 1) {

        dirdmarkers[0].setMap(null);
        dirdmarkers = [];
    }
}

function makeMarkerPickup(position, icon, title) {
    if (dirdmarkers.length == 0) {
        dirpikmarker = new google.maps.Marker({
            position: position,
            map: map,
            icon: icon,
            title: title
        });
        dirdmarkers.push(dirpikmarker);
    }
    if (dirmarkers.length == 1) {

        dirmarkers[0].setMap(null);
        dirmarkers = [];
    }
};

